import React,{useState} from 'react';
import './Login.css';
import Test from './Test';
import './DropdownList.css'
import { Link } from 'react-router-dom';

function Dashboard({location}) {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };
  return (
    <div>
      <header>
        <h2 className="logo">GlucoWise</h2>
        <nav className="navigation">
          <Link to="/">Home</Link>
          <Link to="#">News</Link>
          <Link to="#">Feedback</Link>
          <Link to="#">About</Link>
          <button className="loginbtn" onClick={toggleDropdown}>Login</button>
        </nav>
      </header>
      {isOpen && (
        <div className="dropdown-content">
          <Link className="drop" to="/login">Login as Patient</Link>
          <Link className="drop" to="/doctorLogin">Login as Doctor</Link>
        </div>
      )}
      <div>
        <Link to="/test" type="submit" className="quiz">Take the Test</Link>
      </div>
    </div>
  );
}

export default Dashboard;
